import React from 'react';
import Appbar from './Appbar'
import Business from "./Businesses"
import { BrowserRouter as R, Route, Link } from "react-router-dom";
import './App.css';

function App() {
  const [t, st] = React.useState("Massaquoi Royal");
  return (
    <div className="App"> 
    <Appbar t={t}/>
      <R>
        <Route component={Business} path="/" /> <Business/>
      </R>


    </div>
  );
}

export default App;
